import React from 'react'



const User = (props) =>{
    const loader = props.loader
    const data = props.data

    return (
        <>
         <nav><h1>User</h1>
         <ul><li>About</li><li>Contact</li></ul>
         <Button  variant="primary">Add a user</Button>
         </nav>
         {!loader ? <Spinner animation="grow" /> : <div className = "user-table"><h1>Homepage</h1><Data data = {data}/> </div>  } 
      
        </>
    )
}

export default User;
